import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Dashboard from './components/Dashboard.js';

function App() {
  return (
      <Routes>
        <Route path="/" exact component={Dashboard} />
      </Routes>
  );
}

export default App;
